import React from "react";
import { useMsal } from "@azure/msal-react";
import { useState, useEffect } from "react"
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import Button from "react-bootstrap/Button"
import { callForUser, callForNextUser, callForEvent } from "./GraphCalls"

function handleLogin(instance) {
    //Handles login and catches exceptions
    instance.loginRedirect(loginRequest).catch(e => {
        console.error(e);
    });
}

function handleLogout(instance){
    //Handles login and catches exceptions
    instance.logoutRedirect().catch(e => {
        console.error(e);
    });
}

export function GetUsers(){
    const { instance, accounts } = useMsal();
    const [curUser, setCurUser] = useState(null);

    function CallUser(){
        const request = {
            ...loginRequest,
            account: accounts[0]
        };

        instance.acquireTokenSilent(request).then((res) => {
            callForUser(res.accessToken).then((res) => getEvent(res.value))
        }).catch((e) =>{
        instance.acquireTokenPopup(request).then((res) => {
            callForUser(res.accessToken).then((res) => getEvent(res))
        })
        })
    }

    console.log(curUser);

    function getEvent(data){

        const request = {
            ...loginRequest,
            account: accounts[0]
        };

        var arr = [];

        data.map(user => {
            const u = user.userPrincipalName;
            instance.acquireTokenSilent(request).then((res) => {
                callForEvent(res.accessToken, u).then((res) => {
                    const userMeet = [res.value[0].subject, user.displayName, res.value[0].startTime]
                    arr.push(userMeet);
